import React, { Component } from "react";
import Weather from "./Weather";

class Find extends Component {
  render() {
    return (
      <React.Fragment>
        <div
          style={{ border: "1px solid green", color: "green", margin: "20px" }}
        >
          <h1>Find Component</h1>
          <Weather city={this.props.match.params.id} />
        </div>
      </React.Fragment>
    );
  }
}

export default Find;
